  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for St. Croix
  Wetland Management District summarizes district activities during the 1998 fiscal
  year.  The report begins with a summary of the years highlights and climatic conditions.
  Monitoring and studies is covered, including surveys and censuses and studies and
  investigations.  The report includes a habitat restoration section which discusses
  wetland restoration, upland restoration, deepwaterriverine restoration. Habitat
  management is outlined; information about water level management, moist soil management,
  grazemowhay, farming, forest management, fire management, pest plants control.  Fish
  and wildlife management is also covered.  Subjects include bird banding, disease
  monitoring and treatment, reintroductions, nest structures, pest, predator and exotic
  animal control.  The coordination activities section of the report discusses interagency
  coordination, tribal coordination, private land activities, cooperativefriends organizations,
  and volunteers.  The resource protection for the district described in this report
  include law enforcement, permits and economic use management, permits and economic
  use management, contaminant investigation, contaminant cleanup, water rights management,
  cultural resources management, land acquisition support, and threats and conflicts.
  \ The public education and recreation section of the report provides information
  about provide visitor services and outreach.  Planning and administration are provided
  at the end.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\": [{\n\t\t\"key\":
